#!/usr/bin/env pytest

import platform
import pytest
import shapely

from digital_land.datatype.wkt import WktDataType
from digital_land.log import IssueLog


def issue_type(issues):
    if issues.rows == []:
        return None
    issue = issues.rows.pop()
    assert issues.rows == []
    return issue["issue-type"]


def test_parse_wkt_polygon():
    wkt = WktDataType()
    issues = IssueLog()
    normalised = wkt.normalise(
        "Polygon ((177556.8532 38417.5297999997,177554.4128 38418.3279999997,177549.4009 38419.9708999991,177547.6712 38420.5159000009,177548.2506 38422.5782999992,177549.7508 38422.1910999995,177553.3995 38420.8543999996,177555.9324 38419.9307000004,177557.5129 38419.3800000008,177556.8532 38417.5297999997))",  # noqa: E501
        issues=issues,
    )
    assert (
        normalised
        == "MULTIPOLYGON (((-5.1186220 50.2038647,-5.1186139 50.2038816,-5.1187241 50.2039039,-5.1187453 50.2039068,-5.1187522 50.2038881,-5.1187277 50.2038839,-5.1186220 50.2038647)))"  # noqa: E501
    )

    geometry = shapely.wkt.loads(normalised)
    assert geometry.is_valid


def test_wkt_point_wgs84():
    wkt = WktDataType()
    issues = IssueLog()

    # Nelson's colum
    normalised = wkt.normalise("POINT( -0.127972   51.507722 )", issues=issues)
    assert normalised == "POINT (-0.1279720 51.5077220)"
    assert issue_type(issues) is None

    geometry = shapely.wkt.loads(normalised)
    assert geometry.is_valid


